import reducer from './reducer';
import { useReducer } from 'react';
function ReducerTest() {
  const [data, dispatchDate] = useReducer(reducer, {
    inputValue: '',
    list: [1, 2, 3],
  });
  return (
    <>
      <ul>
        {data.list.map((item) => {
          return <li key={item}>{item}</li>;
        })}
      </ul>
    </>
  );
}
export default ReducerTest;
